webpackJsonp([0xc76c2e504617],{1335:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/squiddler/index.md absPath of file >>> MarkdownRemark",html:'<p>Squiddler has done some really cool stuff on the Flash platform, most of his blog posts are worth reading but check out these ones specifically:</p>\n<p><strong>Bumblebee:</strong> <a href="http://www.squidder.com/2008/11/14/bumblebee-the-easiest-path-from-excel-to-xml/">http://www.squidder.com/2008/11/14/bumblebee-the-easiest-path-from-excel-to-xml/</a> This AIR application is pretty cool - it allows you to take excel files and transform them into xml files by providing a simple template. Could be useful in those instances where we get the client to fill out a spreadsheet of information.</p>\n<p><strong>Real-time face recognition:</strong> <a href="http://www.squidder.com/2009/02/26/realtime-face-detection-in-flash/">http://www.squidder.com/2009/02/26/realtime-face-detection-in-flash/</a></p>\n<p><strong>AR drum kit:</strong> <a href="http://www.squidder.com/2009/03/03/augmented-reality-drum-kit/">http://www.squidder.com/2009/03/03/augmented-reality-drum-kit/</a></p>\n<p><strong>Other posts at:</strong> <a href="http://www.squidder.com/">http://www.squidder.com/</a></p>',frontmatter:{title:"Squiddler",date:"March 16, 2009",tags:["air-applications","augmented-reality","excel"],url:null}}},pathContext:{prev:{frontmatter:{path:"/blog/starrequests-simple-box2d-flickr-mashup-sample/",tags:["actionscript","flickr","github","simple-box2d","starrequests"],title:"StarRequests, Simple-Box2D & Flickr - a example mashup.",image:null,date:"2010-06-07T23:44:30.000Z"}},next:{frontmatter:{path:"/blog/smashing-flash-websites/",tags:["design","flash","blogroll"],title:"2 Smashing Flash Websites...",image:null,date:"2007-07-20T19:31:46.000Z"}}}}}});
